import React, { Component } from "react";
 
class Favorite extends Component {
  render() {
    return (
      <div>
        <h2>Favorite Books</h2>
        <p>Best Italian novels:</p>
        <ol>
          <li>Dantes Inferno</li>
          <li>Purgatorio</li>
          <li>Paradiso</li>
        </ol>
      </div>
    );
  }
}
 
export default Favorite;
